import React from 'react';
import ReactDOM from 'react-dom';
//import injectTapEventPlugin from 'react-tap-event-plugin';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import RaisedButton from 'material-ui/RaisedButton';
import FlatButton from 'material-ui/FlatButton';
import Dialog from 'material-ui/Dialog';
import TextField from 'material-ui/TextField';
import Paper from 'material-ui/Paper';

//injectTapEventPlugin();

var d = (a)=> {
    return document.getElementById(a)
};
var Nbsp = React.createClass({
    render: function () {
        return (
            <span>&nbsp;</span>
        )
    }
});

var BookmarksBar = React.createClass({
    getInitialState: function () {
        return {
            bookmarks: '',
            boomarksElements: []
        }
    },
    printBookmark: function (bookmarks) {
        var self = this;
        bookmarks[0].children.forEach(function (bookmark) {
            if (bookmark.children) {
                console.log(bookmark);
            }
        });
    },
    componentDidMount: function () {
        var self = this;
        chrome.bookmarks.getTree(function (bookmarks) {
            self.printBookmark(bookmarks);
        });
    },
    render: function () {
        return (
            <div>
                {
                    this.state.bookmarksElements
                    }
            </div>
        );
    }
});

var BackgroundImage = React.createClass({
    getInitialState: function () {
        return {uri: ''};
    },
    componentDidMount: function () {
        var self = this;
        chrome.storage.local.get('bg', function (data) {
            if (data.hasOwnProperty('bg') && data.bg.uri !== null) {
                self.setState({uri: data.bg.uri});
            }
        });
    },
    render: function () {
        var self = this;
        return (
            <div id='bgImage'
                 style={{backgroundImage:self.state.uri,backgroundSize:'cover',position:'absolute',top:'0',bottom:'0',width:'100vw',height:'100vh'}}></div>
        );
    }
});

var ButtonsContainer = React.createClass({
    componentDidMount: function () {
        var self = this;
        chrome.storage.local.get('links', function (data) {
            if (data.hasOwnProperty('links') && data.links.one !== null) {
                self.setState({
                    links: {
                        one: data.links.one,
                        two: data.links.two,
                        three: data.links.three,
                        bottom: data.links.bottom
                    }
                });
            }
        });
        chrome.storage.local.get('titles', function (data) {
            if (data.hasOwnProperty('titles') && data.titles.one !== null) {
                self.setState({
                    titles: {
                        one: data.titles.one,
                        two: data.titles.two,
                        three: data.titles.three,
                        bottom: data.titles.bottom
                    }
                });
            }
        });
    },
    getInitialState: function () {
        return {
            links: {
                one: 'https://mail.google.com/',
                two: 'https://youtube.com/',
                three: 'https://soundcloud.com/',
                bottom: 'https://www.wunderlist.com/lists/week'
            },
            titles: {
                one: 'Gmail',
                two: 'Youtube',
                three: 'SoundCloud',
                bottom: 'Wunderlist'
            },
            ctmOpen: false
        };
    },
    openContextMenu: function (e) {
        e.preventDefault();
        this.setState({ctmOpen: true, x: e.clientX + 'px', y: e.clientY + 'px'});
    },
    render: function () {
        return (<div
                style={{textAlign: 'center',position:'absolute',top:'calc(50vh - (15vh + (36px / 2)))',width:'100vw'}}>
                <a href={this.state.links.one}>
                    <RaisedButton onContextMenu={this.openContextMenu} label={this.state.titles.one}
                                  labelStyle={{top:'calc(7.5vw - 7px)'}}
                                  style={{width:'15vw',height:'15vw'}} primary={true}/>
                </a>
                <Nbsp />
                <a href={this.state.links.two}>
                    <RaisedButton label={this.state.titles.two} labelStyle={{top:'calc(7.5vw - 7px)'}}
                                  style={{width:'15vw',height:'15vw'}} primary={true}/>
                </a>
                <Nbsp />
                <a href={this.state.links.three}>
                    <RaisedButton label={this.state.titles.three} labelStyle={{top:'calc(7.5vw - 7px)'}}
                                  style={{width:'15vw',height:'15vw'}} primary={true}/>
                </a>
                <br /><br />
                <a href={this.state.links.bottom}>
                    <RaisedButton label={this.state.titles.bottom}
                                  style={{minWidth:'calc(15vw * 3 + 10px)',width:'calc(15vw * 3 + 10px)'}}
                                  primary={true} fullWidth={true}/>
                </a>
            </div>
        );
    }
});

var ChangeBackground = React.createClass({
    getInitialState: function () {
        return {
            open: false, links: {
                one: 'https://mail.google.com/',
                two: 'https://youtube.com/',
                three: 'https://soundcloud.com/',
                bottom: 'https://www.wunderlist.com/lists/week'
            },
            titles: {
                one: 'Gmail',
                two: 'Youtube',
                three: 'SoundCloud',
                bottom: 'Wunderlist'
            }
        };
    },
    handleOpen: function () {
        this.setState({open: true});
    },
    handleClose: function () {
        this.setState({open: false});
    },
    changeLinks: function () {
        chrome.storage.local.set({
            links: {
                one: d('buttonOne').value,
                two: d('buttonTwo').value,
                three: d('buttonThree').value,
                bottom: d('bottomButton').value
            },
            titles: {
                one: d('buttonOneTitle').value,
                two: d('buttonTwoTitle').value,
                three: d('buttonThreeTitle').value,
                bottom: d('bottomButtonTitle').value
            }
        });
        location.reload();
    },
    componentDidMount: function () {
        var self = this;
        chrome.storage.local.get('links', function (data) {
            if (data.hasOwnProperty('links') && data.links.one !== null) {
                self.setState({
                    links: {
                        one: data.links.one,
                        two: data.links.two,
                        three: data.links.three,
                        bottom: data.links.bottom
                    }
                });
            }
        });
        chrome.storage.local.get('titles', function (data) {
            if (data.hasOwnProperty('titles') && data.titles.one !== null) {
                self.setState({
                    titles: {
                        one: data.titles.one,
                        two: data.titles.two,
                        three: data.titles.three,
                        bottom: data.titles.bottom
                    }
                });
            }
        });
    },
    render: function () {
        var actions = [
            <FlatButton
                label="Cancel"
                onTouchTap={this.handleClose}
            />,
            <FlatButton
                label="Submit"
                onTouchTap={this.changeLinks}
            />
        ];
        return (
            <div>
                <FlatButton id="changeBackground" label="Change Background"
                            style={{width:'50vw',position:'absolute',bottom:'5px'}} labelStyle={{color:'white'}}/>
                <FlatButton id="linkUrls" label="Change Button Links"
                            style={{width:'50vw',position:'absolute',bottom:'5px',left:'50vw'}}
                            labelStyle={{color:'white'}} onClick={this.handleOpen}/>
                <input type="file" hidden="true" id="bgImageForm"/>
                <Dialog title="Configure Buttons" actions={actions} modal={false} open={this.state.open}
                        onRequestClose={this.handleClose}>
                    <div style={{float:'left'}}>
                        <TextField
                            defaultValue={this.state.links.one}
                            id="buttonOne"
                            hintText="First Button Link"
                        />
                        <br />
                        <TextField
                            defaultValue={this.state.links.two}
                            id="buttonTwo"
                            hintText="Second Button Link"
                        />
                        <br />
                        <TextField
                            defaultValue={this.state.links.three}
                            id="buttonThree"
                            hintText="Third Button Link"
                        /><br />
                        <TextField
                            defaultValue={this.state.links.bottom}
                            id="bottomButton"
                            hintText="Bottom Button Link"
                        />
                    </div>
                    <div style={{float:'right'}}>
                        <TextField
                            id="buttonOneTitle"
                            defaultValue={this.state.titles.one}
                            hintText="First Button Title"
                        />
                        <br />
                        <TextField
                            defaultValue={this.state.titles.two}
                            id="buttonTwoTitle"
                            hintText="Second Button Title"
                        />
                        <br />

                        <TextField
                            defaultValue={this.state.titles.three}
                            id="buttonThreeTitle"
                            hintText="Third Button Title"
                        />
                        <br />
                        <TextField
                            defaultValue={this.state.titles.bottom}
                            id="bottomButtonTitle"
                            hintText="Bottom Button Title"
                        />
                    </div>
                </Dialog>
            </div>
        );
    }
});

var NewTab = React.createClass({
    componentDidMount: function () {
        chrome.storage.local.get('bg', function (data) {
            if (data.hasOwnProperty('bg') && data.bg.rui !== null) {
                d('bgImage').style.backgroundImage = data.bg.uri;
            }
            else {
                d('bgImage').style.backgroundImage = "url('data:image/png;base64,')";
            }
            document.body.style.opacity = document.documentElement.style.opacity = 1;
        });
    },
    render: function () {
        return (
            <MuiThemeProvider>
                <div>
                    <BookmarksBar />
                    <BackgroundImage />
                    <ButtonsContainer />
                    <ChangeBackground />
                </div>
            </MuiThemeProvider>
        );
    }
});

ReactDOM.render(<NewTab />, d('container'));

d('changeBackground').onclick = function () {
    d('bgImageForm').click()
};
d('bgImageForm').onchange = function () {
    var reader = new FileReader();
    reader.onload = (function (aImg) {
        return function (e) {
            aImg.style.backgroundImage = 'url(' + e.target.result + ')';
            chrome.storage.local.set({'bg': {'uri': 'url(' + e.target.result + ')'}});
        };
    })(d('bgImage'));
    reader.readAsDataURL(this.files[0]);
};